import { useState } from "react";
import ReactDOM from "react-dom/client";

function App() {
  const [color, setColor] = useState("red");

  return <h1>My favorite color is {color}!</h1>
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);
